    arname    VARCHAR (50),
    arlatein  VARCHAR (100),
    suchen    VARCHAR (255),
    areuria   INTEGER,
    areurin   INTEGER,
    argmin    INTEGER,
    argmax    INTEGER,
    arfmin    INTEGER,
    arfmax    INTEGER,
    arneunutz VARCHAR (100),
    arneudatu DATE,
    arneuzeit TIME,
    araennutz VARCHAR (100),
    araendatu DATE,
    araenzeit TIME
);

');

COMMIT TRANSACTION;
PRAGMA foreign_keys = on;
